import Dropdown from "react-bootstrap/Dropdown";
const SubNavbar = () => {
  return (
    <div className="d-flex justify-content-between bg-dark text-light px-4">
      <div className="d-flex">
        <h2 className="mb-4">TV Shows</h2>
        <Dropdown>
          <Dropdown.Toggle variant="success" id="dropdown-basic" className="bg-transparent dropdownSubNavbar">
            Generes
          </Dropdown.Toggle>

          <Dropdown.Menu>
            <Dropdown.Item href="#/action-1">Action</Dropdown.Item>
            <Dropdown.Item href="#/action-2">Another action</Dropdown.Item>
            <Dropdown.Item href="#/action-3">Something else</Dropdown.Item>
          </Dropdown.Menu>
        </Dropdown>
      </div>
      <div>
        <i class="bi bi-grid icons"></i>
        <i class="bi bi-grid-3x3 icons"></i>
      </div>
    </div>
  );
};
export default SubNavbar;
